import React, { Component } from "react";
import Navbar from "./Navbar";
import "./App.css";
import Web3 from "web3";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      account: "0x0",
    };
  }

  render() {
    return (
      <div>
        <Navbar account={this.state.account}></Navbar>

        <div>
          <h1 style={{ color: "green" }}> hell world </h1>
        </div>
      </div>
    );
  }
}

export default App;

